fields.description:
Привет! Мы — техническая команда продуктовой украинской компании «Реактор». Ты можешь знать нас по проектам Work.ua, Education.ua, TRN.ua, Ratatype.com. Мы делаем продукты, которые становятся лидерами рынка. Например, Work.ua входит в 20 самых посещаемых сайтов Украины и помогает находить работу миллионам людей.

У нас много планов и амбиций, поэтому сейчас мы расширяемся и ищем программистов, которым интересно:

    сражаться с highload (посещаемость сайта — 5 млн человек в месяц);
    работать над улучшением поиска на Work.ua;
    повышать скорость работы сайта;
    воплощать в жизнь новые бизнес-идеи.

Что нужно будет делать:

    разрабатывать новую и оптимизировать текущую функциональность проекта Work.ua;
    участвовать в принятии решений о методах и средствах реализации задач;
    анализировать требования к проекту и оценивать сроки его выполнения;
    писать тесты и проводить нагрузочное тестирование;
    участвовать в Code review и поддерживать техническую документацию проекта;
    периодически участвовать в разработке и поддержке других проектов компании «Реактор».

Due to the extension of the department, we are inviting the Middle\Senior Python Developer to our team.

Requirements:

    Familiarity with Python, OOP, algorithms, and data structures
    To be proficient with building a web application using Django, Flask
    Version control system experience (Mercurial, git)
    MySQL
    English intermediate (B1) and higher

Working environment:

    comfortable working conditions in a modern office in the center of the city (near the park area);
    work in a friendly and cheerful team of professionals;
    interesting tasks and possibilities for development;
    prospects of professional and career growth;
    English lessons at the company’s office;
    flexible working hours;
    paid leave and overtime;
    the level of salary is determined according to the results of the interview.

We will be glad to consider your application!
